  faVideo,
  faMicrophone,
  faPhone,
  faAngleUp,
  faClosedCaptioning,
  faDesktop,
  faMicrophoneSlash,
} from "@fortawesome/free-solid-svg-icons";

const CallPageFooter = () => {
  return (
    <div className="footer-item">
      .left
      <div className="icon-block">
        Meeting details
        <FontAwesomeIcon className="icon" icon={faAngleUp} />
      </div>
    </div>
  );
};

export default CallPageFooter;
